import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchInventory } from '../../app/features/Inventory/inventoryAsyncThunk';

const Inventory = () =>{
    const dispatch = useDispatch();
    const inventory = useSelector((state) => state.inevntory.inventory);
    const status = useSelector((state) => state.inventory.status);
    const error = useSelector((state) => state.inventory.error);

    useEffect(() => {
        // Dispatch the fetchDailyOrders action with the selected date
        dispatch(fetchInventory);
      }, [dispatch]);

      
  // Render loading state
  if (status === 'loading') {
    return <div>Loading...</div>;
  }

  // Render error state
  if (status === 'failed') {
    return <div>Error: {error}</div>;
  }

  console.log(inventory);

  return(
    <div>
        { inventory.map(part =>{
            return(
                <div>
                    <p>{part.ItemCode}</p>
                </div>
            )
        })

        }
    </div>
  );

}

export default Inventory;
